export default  {
    users: [
      { username: "regular", accessLevel: 1, password: "password" },
      { username: "Bob", accessLevel: 2, password: "password" },
      { username: "Tom", accessLevel: 3, password: "password" },
      { username: "Harry", accessLevel: 0, password: "password" },
      { username: "admin", accessLevel: 0, password: "password" }
    ],
    initProducts: [
      {
        name: "butter",
        stock: 10,
        price: 399.99,
        shortDesc: "Butter is good for health.",
        description:
          "Butter is the dairy product made from churning milk or cream.In the Bible, butter is a food for celebration."
      },
    ]
  };
